import React from 'react';
import board from './board.PNG';
import './App.css';
import UserComponent from './component/UserComponent';

function App() {


    function refreshPage() {
        window.location.reload(false);
    }

    return (
        <div className="App">
            <div>
                <button onClick={refreshPage}>Click to reload!</button>
            </div>
            <UserComponent />
            <img src={board} />
        </div>
    );
}

export default App;
